const Header=(props)=>(
  <>
  <h1>{props.course}</h1>
  </>
)
const Parts=(props)=>(
  <>
   <p>
    {props.parts.name} {props.parts.exercises}
    </p>
  </>
)
const Content=(props)=>(
      <>

      <Parts parts={props.part1}/>
      <Parts parts={props.part2}/>
      <Parts parts={props.part3}/>
  </>
)
const Total=(p)=>{
  const sum=p.forEach(v=>sum+v)
  console.log(sum)
  return(
    <p>Number of exercises {sum}</p>
  )
}

const App=()=>{
  const course='Half Stack application development'
  const parts = [
    {
      name: 'Fundamentals of React',
      exercises: 10
    },
    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]

  return(
    <div>
      <Header 
      course={course}
      />
      <Content parts={parts}
      />
      <Total
      parts={parts}
      />
    </div>
  )
}
export default App
